import React from 'react';
import Link from 'next/link';

const Header = () => (
  <header>
    <div className="bar">
      <Link href="/">Sick fits</Link>
    </div>
    <div className="sub-bar">
      <p>Search</p>
    </div>
  </header>
);

export default Header;
